import React from 'react';

import Banner from './blog/banner';
import BlogCategory from './blog/blogcategory';
import BlogArea from './blog/blogarea';

function Blog() {
    return (
        <react-fragment>
            <Banner />
            <BlogCategory />
        </react-fragment>
    );
}

export default Blog;
